    date: '2024-09-28'
  },
  {
    author: 'Vehicle Owner Mark',
    rating: 4,
    review: 'Good multi-car coverage with solid discounts. Easy to manage all our vehicles under one policy.',
    date: '2024-09-20'
  }
])

